What a show last night! If you missed it, it’s loaded on our channel now. 
In Regards to the “If You Ain’t First , You’re Last”  Thorne in my Side Challenge, Fans of The Shake and Bake Show have raised over $2500 so far for the competitor that Pushes The Champ in the beams first. This will start In Chicago, due to the complexities of the staging process at Charlotte 4 Wide. The rules are as follows 

Beginning in Chicago, The first Man or Woman  that stages their car into final stage beams last against the current and Reigning Champ during eliminations , gets the entire pot that has been raised up to that point in cash. (So Far $2515.  An updated total will be provided before eliminations begin)  If you are both thrown out for taking too long, you still win. 
No Splitting. 
 Huge thanks to the outpouring of support from the Pro Mod community and our family of fans. As well as @nhra and @nhra_promodified for fostering an environment where we can showcase these exciting cars and rivalries and celebrate the personalities that make our sport great. Also, @wfojoe Joe Costello did an amazing job on that call during E1. The fans were on their feet. It will be an interesting rest of The Pro Mod Season. 
